import React, { Component } from 'react';

class SearchResult extends Component {
    render () {
        return(
          <div>
            <ul>
              {this.props.searchUsers.map(function(value) {
                return <Item key={value} val={value} />
              })}
            </ul>
          </div>
        )
      }
}

export default SearchResult;
